import DiscoverLogo from '../../../src/assets/discover-logo.svg';
import SwiperCore, {
  Pagination,Navigation
} from 'swiper/core';

// install Swiper modules
SwiperCore.use([Pagination,Navigation]);

const Explore=()=>{



    return(
        <Container fluid="md">
        <Col>
        <Row sm={3} className="text-center justify-content-center align-items-center"><img className="headerImg" src={DiscoverLogo} alt="React Logo" /></Row>
        <Row sm={3}>    <>

    <Swiper onSwiper={setSwiperRef} slidesPerView={3} centeredSlides={true} spaceBetween={30} pagination={{
    "type": "fraction"
  }} navigation={true} className="mySwiper">
      <SwiperSlide>Slide 1</SwiperSlide>
      <SwiperSlide>Slide 2</SwiperSlide>
      <SwiperSlide>Slide 3</SwiperSlide>
      <SwiperSlide>Slide 4</SwiperSlide>
    </Swiper>

      </></Row>
        <Row sm={6}>sm=6</Row>
        </Col>
      </Container>
    )
}

export default Explore;
